import styled from 'styled-components';

const Wrapper = styled.div`
  width: 100%;
  height: 100vh;
  position: relative;
  z-index: -1;
  background: grey;
`;

const FontElement = styled.div`
  position: absolute;
  width: 300px;
  height: 20px;
  background: white;
  outline: 3px solid black;
  z-index: 1000;
  padding: 20px;
`;

// element 元件都先寫在這邊

export default function Stage({ previousData }) {
  console.log('previousData', previousData);
  return (
    <Wrapper id='theatre-stage'>
      {previousData.map((data, index) => {
        <FontElement key={index} id={data.id} style={data.style}>
          {data.content}
        </FontElement>;
      })}
    </Wrapper>
  );
}
